import React from 'react';
import { MDBDataTable } from 'mdbreact'
import { useState } from 'react';
import { useEffect } from 'react';
import axios from 'axios';

const Admin= () => {

  var rowdata={
    name:"",
    price:""
  }
  var[cakes,setCakes]=useState({})
  var allcakeurl="https://apibyashu.herokuapp.com/api/allcakes"
  useEffect(()=>{
    axios({
  method:"get",
  url:allcakeurl
  }).then((response)=>{
  console.log("response from all cake api",response.data.data)
  setCakes(response.data.data)

    },(error)=>{
  console.log("Error from all cake api",error)
})
},[])

   cakes.map((each,index)=>{
     rowdata.name=each.name,
     rowdata.price=each.price
   })

   console.log(",,,row data",rowdata)

  const data = {
    columns: [
      {
        label: 'Name',
        field: 'name',
        sort: 'asc',
        width: 150
      },
      {
        label: 'Position',
        field: 'position',
        sort: 'asc',
        width: 270
      },
      {
        label: 'Office',
        field: 'office',
        sort: 'asc',
        width: 200
      },
      {
        label: 'Age',
        field: 'age',
        sort: 'asc',
        width: 100
      },
      {
        label: 'Start date',
        field: 'date',
        sort: 'asc',
        width: 150
      },
      {
        label: 'Salary',
        field: 'salary',
        sort: 'asc',
        width: 100
      }
    ],
    rows: []
  };

  return (
    <MDBDataTable
      striped
      bordered
      small
      data={data}
    />
  );
}

export default Admin;
